
public class Message {
	
	private String m; 
	private int status; 

	public Message(String m, int status) {
		this.m=m; 
		this.status=status;
	}

	public Message() {
		// TODO Auto-generated constructor stub
	}

	public String getM() {
		return m;
	}

	public void setM(String m) {
		this.m = m;
	}

	public int getStatus() {
		return status;
	}

	public void setStatus(int status) {
		this.status = status;
	}


}
